import React from 'react';
import Login from "./components/login.js";
import { Route, Routes } from 'react-router-dom';


function App() {
  return (
    <div className="App">
      <Routes>
        <Route path='/' element={<Login/>}/>
      </Routes>
      <Login />
    </div>
  );
}

export default App;
